import styles from '../css/login.module.css'
import Head from 'next/head'
import FormLogin from '../component/FormLogin'

const Index = () => (
    <div className={`${styles["body-login"]}`}>
        <div className={styles.test}></div>
        <div className="modal-dialog text-center">
            <Head>
                <title>Login</title>
                <link rel="stylesheet"
                    href="https://bootswatch.com/4/cosmo/bootstrap.min.css" />
            </Head>
            <div className={`col-sm-8 ${styles["modal-section"]}`}>
                <div className="modal-content">
                    <div className="col-12 img-login">
                        <img src="https://i.imgur.com/rqyck4A.png" />
                    </div>
                    <FormLogin />
                </div>
            </div>

        </div>

        <style jsx global>{`
            body{
                background: url("https://image.freepik.com/foto-gratis/interior-moderno-espacio-oficina_158595-5206.jpg") no-repeat center center fixed;
                filter: blur(8px);
                background-size: cover;

            }
        `}
        </style>

    </div>

);

export default Index;
